import React from 'react'
import { BsSearch } from 'react-icons/bs';


const Search = () => {
    return (
        <form>
            <label>
                <span>Search <BsSearch /></span>
                <input type="text" name="search" placeholder="What do you want to cook?" />
            </label>
            <button>Search</button>
        </form>
    )
}

export default Search
